(6, '429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh ', '\n#### **GIỚI THIỆU CHUNG**\n\nDoctor Check tự hào là Trung tâm Nội soi Tiêu hoá được Sở Y tế cấp phép đạt chuẩn thực hiện nội soi tiêu hoá “không đau”.\n\nTrung tâm nội soi và chẩn đoán bệnh lý tiêu hoá Doctor Check là đơn vị chuyên sâu về nội soi tiêu hóa, 100% Bác sĩ Nội soi tại Doctor Check được tập huấn chuyên sâu về nội soi chẩn đoán bệnh lý ống tiêu hoá và tầm soát ung thư sớm của ống tiêu hóa.\n\nTrung tâm còn trang bị đầu tư các loại máy móc tiên tiến, ứng dụng trí tuệ nhân tạo (AI) giúp phát hiện các tổn thương chỉ là nhỏ nhất và hỗ trợ bác sĩ có thể chẩn đoán bệnh hiệu quả. Trung tâm không chỉ đầu tư về các loại máy nội soi mà còn trang bị các loại máy móc hỗ trợ khác trong toàn bộ quá trình khám của bệnh nhân như: Máy chụp Xquang, siêu âm hiện đại, Hệ thống máy xét nghiệm tự động,...\n\nNhư vậy, đây là địa chỉ thăm khám và điều trị chuyên sâu về bệnh lý tiêu hóa, phù hợp với người bệnh có nhu cầu khám chuyên sâu về các mặt bệnh này.\n\n**Địa chỉ:** 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh \n\n**Thời gian làm việc:** \n\nTừ 6h - 15h (Thứ 2 - Thứ 7 hàng tuần)\n**Hình thức thanh toán:**\n\nPhòng khám có thanh toán bằng hình thức Quẹt thẻ, Tiền mặt, Chuyển khoản, Bảo hiểm tư nhân\n\n#### **THẾ MẠNH CHUYÊN MÔN**\n\nDoctor Check cung cấp toàn diện các dịch vụ về thăm khám và điều trị chuyên sâu các bệnh lý tiêu hóa cũng như tầm soát ung thư tiêu hóa như:\n\n* Khám tiêu hóa và tầm soát ung thư tiêu hóa\n* Nội soi ống tiêu hóa và cắt polyp qua nội soi\n* Xét nghiệm chuyên sâu: xét nghiệm máu, xét nghiệm nước tiểu, xét nghiệm phân\n* Chẩn đoán hình ảnh tiêu hoá\n* Thăm dò chức năng tiêu hoá\n\nLưu ý: Trung tâm không điều trị bằng phương pháp phẫu thuật.\n\n\n#### **TRANG THIẾT BỊ**\n\nDoctor Check sử dụng hệ thống máy móc thiết bị tiên tiến nhất hiện nay giúp bác sĩ chẩn đoán nguyên nhân gây bệnh chính xác lên tới 99%. Doctor Check trang bị các hệ thống máy nội soi với độ phóng đại 100 – 135 lần giúp Bác sĩ đánh giá tổn thương hiệu quả và giúp sinh thiết chính xác vị trí tổn thương, hạn chế sinh thiết nhiều lần để giảm tối đa rủi ro chảy máu trong nội soi.\n\nViệc đầu tư đồng bộ hệ thống trang thiết bị nội soi cũng như các loại trang thiết bị khác hỗ trợ khám và chẩn đoán hiệu quả, thuận tiện cho người bệnh khi thăm khám.\n\n**Máy nội soi Olympus EVIS X1 CV-1500**\n\n* Bộ xử lý hình ảnh và nguồn sáng EVIS X1\n* Dây nội soi CV 1500 phóng đại 100 lần\n* Chức năng nhuộm ảo (hỗ trợ phát hiện tổn thương) NBI\n* Phần mềm trí tuệ nhân tạo AI (hỗ trợ phát hiện polyp) EndoBRAIN – EYE\n* Màn hình nội soi 32 inches chuẩn 4K\n\n**Máy nội soi Fujifilm 7000**\n\n* Bộ xử lý hình ảnh và nguồn sáng EP 7000\n* Dây nội soi EP 7000 phóng đại 135 lần\n* Chức năng nhuộm ảo (hỗ trợ phát hiện tổn thương) BLI-LCI\n* Phần mềm trí tuệ nhân tạo AI (hỗ trợ phát hiện polyp) EX-1\n* Màn hình nội soi 24 inches chuẩn Full HD.\n\n**Máy siêu âm màu ACSON Juniper (Siemens - Mỹ)**\n\n* Đầu dò Convex dãi tần 1.4 – 5.0 MHz\n* Đầu dò Linear dãi tần 2.6 – 11.5 MHz \n* \n**Máy đo H. pylori bằng phương pháp hơi thở C13**\n\n* Thiết bị đo: FanHp (Fisher – Đức)\n\n* Thuốc thổi: Infai – Đức\n* \n **Hệ thống chụp X - quang kỹ thuật số**\n\n* Máy chụp X – quang cao tần 500mA: Vikomed (Liên danh Việt – Hàn)\n* Tấm nhận ảnh kỹ thuật số: IRAY – Hàn Quốc\n* Máy in phim X – quang: Agfa – Ý \n* Hệ thống máy xét nghiệm\n\n* Máy xét nghiệm Huyết Học: Ruby (Abbott – Mỹ)\n* Máy xét nghiệm Sinh Hóa\n* Miễn Dịch: CI 4100 (Abbott – Mỹ)\n* Máy xét nghiệm Đông Máu: Cobas T 411 (Roche – Thụy Sĩ)\n* Máy xét nghiệm Nước Tiểu: Cobas 1100 (Roche – Thụy Sĩ)\n* Kính hiển vi quan sát: CX-31 (Olympus – Nhật)\n\n\n#### **VỊ TRÍ**\n\nTrung tâm Tiêu hóa Doctor Check nằm tại 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh ', '<h4><strong>GIỚI THIỆU CHUNG</strong></h4>\n<p>Doctor Check tự hào là Trung tâm Nội soi Tiêu hoá được Sở Y tế cấp phép đạt chuẩn thực hiện nội soi tiêu hoá “không đau”.</p>\n<p>Trung tâm nội soi và chẩn đoán bệnh lý tiêu hoá Doctor Check là đơn vị chuyên sâu về nội soi tiêu hóa, 100% Bác sĩ Nội soi tại Doctor Check được tập huấn chuyên sâu về nội soi chẩn đoán bệnh lý ống tiêu hoá và tầm soát ung thư sớm của ống tiêu hóa.</p>\n<p>Trung tâm còn trang bị đầu tư các loại máy móc tiên tiến, ứng dụng trí tuệ nhân tạo (AI) giúp phát hiện các tổn thương chỉ là nhỏ nhất và hỗ trợ bác sĩ có thể chẩn đoán bệnh hiệu quả. Trung tâm không chỉ đầu tư về các loại máy nội soi mà còn trang bị các loại máy móc hỗ trợ khác trong toàn bộ quá trình khám của bệnh nhân như: Máy chụp Xquang, siêu âm hiện đại, Hệ thống máy xét nghiệm tự động,...</p>\n<p>Như vậy, đây là địa chỉ thăm khám và điều trị chuyên sâu về bệnh lý tiêu hóa, phù hợp với người bệnh có nhu cầu khám chuyên sâu về các mặt bệnh này.</p>\n<p><strong>Địa chỉ:</strong> 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Từ 6h - 15h (Thứ 2 - Thứ 7 hàng tuần)\n<strong>Hình thức thanh toán:</strong></p>\n<p>Phòng khám có thanh toán bằng hình thức Quẹt thẻ, Tiền mặt, Chuyển khoản, Bảo hiểm tư nhân</p>\n<h4><strong>THẾ MẠNH CHUYÊN MÔN</strong></h4>\n<p>Doctor Check cung cấp toàn diện các dịch vụ về thăm khám và điều trị chuyên sâu các bệnh lý tiêu hóa cũng như tầm soát ung thư tiêu hóa như:</p>\n<ul>\n<li>Khám tiêu hóa và tầm soát ung thư tiêu hóa</li>\n<li>Nội soi ống tiêu hóa và cắt polyp qua nội soi</li>\n<li>Xét nghiệm chuyên sâu: xét nghiệm máu, xét nghiệm nước tiểu, xét nghiệm phân</li>\n<li>Chẩn đoán hình ảnh tiêu hoá</li>\n<li>Thăm dò chức năng tiêu hoá</li>\n</ul>\n<p>Lưu ý: Trung tâm không điều trị bằng phương pháp phẫu thuật.</p>\n<h4><strong>TRANG THIẾT BỊ</strong></h4>\n<p>Doctor Check sử dụng hệ thống máy móc thiết bị tiên tiến nhất hiện nay giúp bác sĩ chẩn đoán nguyên nhân gây bệnh chính xác lên tới 99%. Doctor Check trang bị các hệ thống máy nội soi với độ phóng đại 100 – 135 lần giúp Bác sĩ đánh giá tổn thương hiệu quả và giúp sinh thiết chính xác