i>\n<p>Kính hiển vi quan sát: CX-31 (Olympus – Nhật)</p>\n</li>\n</ul>\n<h4><strong>VỊ TRÍ</strong></h4>\n<p>Trung tâm Tiêu hóa Doctor Check nằm tại 429 Tô Hiến Thành, Phường 14, Quận 10, Tp. Hồ Chí Minh</p>\n', , 'Doctor Check - Tầm Soát Bệnh Để Sống Thọ Hơn', '2023-12-04 17:16:21', '2023-12-07 14:23:38');
INSERT INTO `Clinic` (`id`, `address`, `descriptionMarkdown`, `descriptionHtml`, `image`, `name`, `createdAt`, `updatedAt`) VALUES
(7, 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', '\n### **GIỚI THIỆU**\n\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.\n\nVì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:\n\n* Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\n* Được khám với quy trình khép kín, không phải di chuyển nhiều.\n* Được tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\n* Khu vực khám riêng tư, lịch sự.\n* Được lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\n* Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\n**Địa chỉ:**Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108\n\n**Thời gian làm việc:**\n\n* 6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\n* Khám cá nhân: Thứ 2 - Thứ 6\n* Khám đoàn và công ty: Thứ 7\n\n\n#### **THẾ MẠNH CHUYÊN MÔN**\n\nTrung tâm khám sức khỏe định kì, thực hiện các dịch vụ:\n\n* Khám theo yêu cầu với Bác sĩ Chuyên khoa.\n* Khám theo các gói khám có sẵn hoặc linh hoạt xây dựng gói khám theo nhu cầu cá nhân.\n\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\n\n#### **TRANG THIẾT BỊ**\n\nTrung tâm khám sức khỏe định kì được trang bị hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam đáp ứng như cầu thăm khám của người bệnh:\n\n* Hệ thống cộng hưởng từ MRI: 2 máy MRI 1.5 Tesla, 2 máy MRI 3.0 Tesla: Phục vụ hiệu quả trong việc hỗ trợ chẩn đoán, phát hiện các khối bất thường.\n* Máy chụp CT320 dãy: Giúp phát hiện các hình ảnh bất thường ở những lát chụp rất nhỏ, hiệu quả hơn trong chẩn đoán và điều trị.\n* 12 máy Xquang kỹ thuật số\n* Chụp vú kỹ thuật số, chụp vú 3D, chụp vú có tiêm thuốc cản quang, sinh thiết vú định vị\n\nVới hệ thống máy móc được trang bị đầy đủ, số lượng máy cũng được chú trọng để giúp bệnh nhân không phải chờ đợi quá lâu trong quá trình thăm khám tại trung tâm.\n\n#### VỊ TRÍ\n\nBệnh viện Trung ương Quân đội 108 nằm gần ngã tư đường Trần Khánh Dư và đường Trần Hưng Đạo.\n\n\n#### **QUY TRÌNH ĐI KHÁM**\n\nDưới đây là hướng dẫn đi khám dành cho người bệnh đặt khám qua BookingCare tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương quân đội 108, bạn vui lòng đọc kỹ.\n\n1. Bạn đến cổng chính của Bệnh viện 108, tại số 1B đường Trần Hưng Đạo, quận Hoàn Kiếm.\n\n* Xe máy bạn có thể gửi tại nhà gửi xe bên tay phải cổng chính. Tuy nhiên, nhà xe này thường xuyên ùn tắc.\n* Xe ô tô: Bạn hỏi nhân viên bảo vệ để được hướng dẫn nơi gửi xe.\n\n 2. Hướng dẫn đi khám tại Trung tâm khám sức khỏe định kỳ - Bệnh viện 108\n 3. Quan trọng: Khách hàng có thể khám theo gói khám đã đặt hoặc khám theo các danh mục bác sĩ tư vấn.\n\n(Nếu khám theo danh mục bác sĩ tư vấn, tổng chi phí có thể cao hơn hoặc thấp hơn chi phí gói khám đã chọn).', '<h3><strong>GIỚI THIỆU</strong></h3>\n<p>Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>\n<p>Vì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:</p>\n<ul>\n<li>Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.</li>\n<li>Được khám với quy trình khép kín, không phải di chuyển nhiều.</li>\n<li>Được tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.</li>\n<li>Khu vực khám riêng tư, lịch sự.</li>\n<li>Được lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.</li>\n<li>Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</li>\n</ul>\n<p>**Địa chỉ:**Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)</li>\n<li>Khám cá nhân: Thứ 2 - Thứ 6</li>\n<li>Khám đoàn và công ty: Thứ 7</li>\n</ul>\n<h4><strong>THẾ MẠNH CHUYÊN MÔN</strong></h4>\n<p>Trung tâm khám sức khỏe định kì, thực hiện các dịch vụ:</p>\n<ul>\n<li>Khám theo yêu cầu với Bác sĩ Chuyên khoa.</li>\n<li>Khám theo các gói khám có sẵn hoặc linh hoạt xây dựng gói khám theo nhu cầu cá nhân.</li>\n</ul>\n<p>Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n<h4><strong>TRANG THIẾT BỊ</strong></h4>\n<p>Trung tâm khám sức khỏe định kì được trang bị hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam đáp ứng như cầu thăm khám của người bệnh:</p>\n<ul>\n<li>Hệ thống cộng hưởng từ MRI: 2 máy MRI 1.5 Tesla, 2 máy MRI 3.0 Tesla: Phục vụ hiệu quả trong việc hỗ trợ chẩn đoán, phát hiện các khối bất thường.</li>\n<li>Máy chụp CT320 dãy: Giúp phát hiện các hình ảnh bất thường ở những lát chụp rất nhỏ, hiệu quả hơn trong chẩn đoán và điều trị.</li>\n<li>12 máy Xquang kỹ thuật số</li>\n<li>Chụp vú kỹ thuật số, chụp vú 3D, chụp vú có tiêm thuốc cản quang, sinh thiết vú định vị</li>\n</ul>\n<p>Với hệ thống máy móc được trang bị đầy đủ, số lượng máy cũng được chú trọng để giúp bệnh nhân không phải chờ đợi quá lâu trong quá trình thăm khám tại trung tâm.</p>\n<h4>VỊ TRÍ</h4>\n<p>Bệnh viện Trung ương Quân đội 108 nằm gần ngã tư đường Trần Khánh Dư và đường Trần Hưng Đạo.</p>\n<h4><strong>QUY TRÌNH ĐI KHÁM</strong></h4>\n<p>Dưới đây là hướng dẫn đi khám dành cho người bệnh đặt khám qua BookingCare tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương quân đội 108, bạn vui lòng đọc kỹ.</p>\n<ol>\n<li>Bạn đến cổng chính của Bệnh viện 108, tại số 1B đường Trần Hưng Đạo, quận Hoàn Kiếm.</li>\n</ol>\n<ul>\n<li>Xe máy bạn có thể gửi tại nhà gửi xe bên tay phải cổng chính. Tuy nhiên, nhà xe này thường xuyên ùn tắc.</li>\n<li>Xe ô tô: Bạn hỏi nhân viên bảo vệ để được hướng dẫn nơi gửi xe.</li>\n</ul>\n<ol start=\"2\">\n<li>Hướng dẫn đi khám tại Trung tâm khám sức khỏe định kỳ - Bệnh viện 108</li>\n<li>Quan trọng: Khách hàng có thể khám theo gói khám đã đặt hoặc khám theo các danh mục bác sĩ tư vấn.</li>\n</ol>\n<p>(Nếu khám theo danh mục bác sĩ tư vấn, tổng chi phí có thể cao hơn hoặc thấp hơn chi phí gói khám đã chọn).</p>\n', , 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', '2023-12-04 17:17:03', '2023-12-07 14:33:00');
