(10, 'Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nộ', '\n\n#### **GIỚI THIỆU**\n\n**Địa chỉ:**  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\n* Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc:** Thứ 2 đến thứ 7\n\n**Sáng: 7h00 - 12h00\nChiều: 13h30 - 16h30**\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng**\n\n* Bệnh viện có nhiều khu khám bệnh, hiện tại BookingCare đang hỗ trợ đăng ký khám tại tòa nhà C4 - Khoa khám bệnh theo yêu cầu. Người bệnh đến khám đúng tòa nhà C4 để được hỗ trợ.\n* Bệnh viện chuyên về Ngoại khoa nên lịch của các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\n* Mỗi bệnh nhân trong ngày chỉ được đặt trước 1 chuyên khoa, nếu đăng kí 2 chuyên khoa trở lên sẽ trao đổi bác sĩ thăm khám ban đầu chuyển khám thêm khoa khác.\n\n**Chi phí khám**\n\nNgười bệnh có thể lựa chọn một trong các gói khám sau:\n\nGói 1:\n* Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\n\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\nGói 2:\n* Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám\n\n\n#### **THẾ MẠNH CHUYÊN MÔN**\n\nBệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:\n\n* **Khám, điều trị, phẫu thuật về Thần kinh (Thần kinh I, Thần kinh II):** Chấn thương; Bệnh lý sọ não; Tuỷ sống; Dây thần kinh ngoại vi; Ứng dụng nội soi trong phẫu thuật thần kinh; Phẫu thuật thần kinh chức năng; Phẫu thuật u nền sọ;...\n* \n* **Khám, điều trị, phẫu thuật về Cơ xương khớp:**\n* **Khám, điều trị, phẫu thuật về Chi trên và Y học thể thao:** Khám các bệnh lý do chấn thương thể thao; Bệnh lý đứt dây chằng gối do chơi thể thao; Chấn thương chỉnh hình xương khớp; Phẫu thuật bàn tay; Bệnh lý cơ xương khớp về tay;...\n* **Khám, điều trị, phẫu thuật về Chi dưới:** Điều trị thoái hóa khớp gối, khớp háng; Bệnh lý đứt dây chằng gối; Phẫu thuật khớp gối, khớp háng, khớp cổ chân; Bệnh lý về chân;...\n* **Khám, điều trị, phẫu thuật về Xương và điều trị ngoại trú:** Nắn chỉnh về xương, tai nạn bị gãy tay gãy chân, tháo bột, kiểm tra lại sau khi nắn chỉnh về xương.\n* **Khám, điều trị, phẫu thuật về chấn thương chung:** tháo đinh, kiếm tra lại sau mổ,...\n* **Khám, điều trị, phẫu thuật về Cột sống: Bệnh lý cột sống;** Đau vai gáy; Thoái hoá và thoát vị đĩa đệm; Chấn thương chỉnh hình cột sống; Trượt đốt sống; Vẹo cột sống; Bơm xi-măng vào thân đốt sống;...\n* **Khám, điều trị, phẫu thuật về Tim mạch và lồng ngực:** Khám và điều trị bệnh lý tim bẩm sinh trẻ em; Khám và điều trị các bệnh lý nội, ngoại khoa về tim mạch; Điều trị các bệnh lý phức tạp về động - tĩnh mạch bằng các phương pháp tiên tiến; Các bệnh lý về xương sườn;...\n* **Khám, điều trị, phẫu thuật về Tạo hình-Hàm mặt-Thẩm mỹ:** Bệnh lý và chấn thương vùng hàm mặt; Phục hồi tái tạo các cơ quan sau điều trị ung thư; Sửa chữa các dị tật sọ mặt; Nối vành tai đứt rời, mũi đứt rời ; Phẫu thuật thẩm mĩ mi mắt, mũi, tạo hình ngực, bụng….\n* **Khám, điều trị, phẫu thuật về Tiêu hóa:** Cắt bỏ và tạo hình thực quản; Cắt khối tá tuỵ; Cắt toàn bộ dạ dày, cắt đại tràng các loại.\n\n**Ngoài ra, bệnh viện khám, điều trị, phâu thuật các chuyên khoa khác như:**\n\n* Bệnh lý thần kinh\n* Nội - Hồi sức thần kinh\n* Bệnh tim mạch và lồng ngực\n* Phẫu thuật tim mạch - lồng ngực\n* Ngoại nhi và trẻ sơ sinh\n* Bệnh lý tiêu hóa\n* Phẫu thuật tiêu hóa\n* Bệnh cột sống/thoát vị đĩa đệm\n* Chi trên và y học  thể thao\n* Bệnh lý chi dưới\n* Khám xương và điều trị ngoại trú\n* Phẫu thuật chấn thương chung\n* Phẫu thuật tạo hình - hàm mặt - thẩm mỹ\n* Phục hồi chức năng\n* Nhiễm khuẩn\n* Phẫu thuật nhiễm khuẩn\n* Bệnh đường tiết niệu\n* Bệnh nam học/nam khoa\n* Bệnh lý gan mật\n* Ung bướu\n* Thận lọc máu\n* Bệnh lý hậu môn trực tràng\n* Trung tâm ghép tạng\n* Phòng khám Tai mũi họng\n\n\n#### **TRANG THIẾT BỊ**\n\nBệnh viện Việt Đức được trang bị hầu hết các trang thiêt bị hiện đại hàng đầu hiện nay phục vụ trong chẩn đoán và thực hiện các xét nghiệm cơ bản, xét nghiệm kỹ thuật cao như các xét nghiệm theo dõi bệnh nhân ghép tạng, các xét nghiệm chỉ điểm khối u.\n\n* Xquang số hóa\n* Máy siêu âm\n* Máy chụp cắt lớp vi tính đa dãy CT Scan\n* Máy chụp cộng hưởng từ MRI 3.0 Tesla\n* Hệ thống chụp mạch máy chuyên dụng\n* Hệ thống PET/CT phát hiện ung thư sớm và đánh giá các bệnh lý tim mạch, thần kinh\n* Hệ thống máy sinh hóa miễn dịch tự động, máy sinh hóa tự động, máy xét nghiệm huyết học, xét nghiệm đông máu tự động…\n\nCác thiết bị thăm dò chức năng hỗ trợ thăm khám và thực hiện các thủ thuật nội soi tiêu hóa - gan mật.\n\nNội soi thực quản - dạ dày - tá tràng chẩn đoán\nNội soi đại trực tràng chẩn đoán\nNội soi đường mật - tụy ngược dòng ERCP\nSiêu âm nội soi chẩn đoán bệnh lý thuộc cơ quan tiêu hóa, chọc hút tế bào\nNội soi can thiệp, nong hẹp đường tiêu hóa\nNội soi đặt stent khí quản, đặt sonde tá tràng\nNội soi can thiệp đại tràng.\n\n#### **VỊ TRÍ**\n\nCác trang web khác ghi địa chỉ Bệnh viện Việt Đức ở 40 Tràng Thi, đây là cổng chính nhưng thông thường chỉ dành cho những công việc giấy tờ, hành chính. Bệnh nhân đến khám sẽ đi các cổng phụ trên đường Phủ Doãn. \n\nTrên đường Phủ Doãn có 3 cổng và đường Tràng Thi có 1 cổng chính. Người bệnh nên đi đúng cổng như chỉ dẫn để đi đến phòng khám dễ dàng, nhanh chóng nhất.\n![img](https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/133335so-do-benh-vien-viet-duc.jpg)\n\n#### **QUY TRÌNH KHÁM**\n\nDưới đây là Hướng dẫn làm thủ tục ưu tiên cho người bệnh đặt khám qua BookingCare tại Bệnh viện Hữu nghị Việt Đức.\n![img](https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/095133-quy-trinh-kham-khu-c4.png)\n**CỤ THỂ:**\n\n1. Bạn đến cổng số 16-18 Phủ Doãn\n\nVề nơi gửi xe:\n\n* Xe máy gửi tại bãi đỗ xe trước cửa bệnh viện (có nhân viên bảo vệ hướng dẫn).\n* Xe ô tô: Hiện tại Bệnh viện chưa có chỗ gửi xe ô tô riêng biệt, xe ô tô bạn có thể gửi tại Cung Văn hóa Hữu nghị Việt Xô, cách bệnh viện khoảng 500m. Nếu được, bạn nên đi taxi để thuận tiện hơn.\n![img](https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/114926cong--so--1-benh-vien-viet-duc.jpg)\n2. Bạn đến Tòa nhà C4: Tòa nhà thứ 2 bên tay trái từ cổng vào số 16-18 Phủ Doãn.\n ![img](https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/160715-c4-bv-viet-duc.jpg)\n3. Vào tầng 1, ĐẾN QUẦY CUNG CẤP THÔNG TIN BÁO ĐẶT QUA BookingCARE. Quý khách đưa tin nhắn xác nhận thành công hoặc hướng dẫn đi khám để nhân viên hỗ trợ (xem thêm hình dưới).\n![img](https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/160921-cung-cap-thong-tin-vd1.jpg)\n* Quý khách lấy số ưu tiên và chờ gọi số tại quầy đăng ký số 7,9 (phiếu khám đã được in sẵn, người bệnh KHÔNG cần khai báo thêm).\n* \n**LƯU Ý:**\n\n* Thời gian phát số ưu tiên sau 07h30. Trường hợp quý khách đến trước 07h30, quý khách vui lòng ngồi chờ tại khu vực sảnh chờ nhà D của bệnh viện\n* Do đặc thù của Bệnh viện Ngoại khoa, Trường hợp Bác sĩ đã đặt có ca CẤP CỨU, PHẪU THUẬT CẤP CỨU, nhân viên lễ tân sẽ sắp xếp cho bạn khám với một bác sĩ khác có chuyên môn và giá khám tương đương.\n4. Bạn sẽ nhận được phiếu khám có dán tem ưu tiên\n![img]()', '<h4><strong>GIỚI THIỆU</strong></h4>\n<p><strong>Địa chỉ:</strong>  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<ul>\n<li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc:</strong> Thứ 2 đến thứ 7</p>\n<p><strong>Sáng: 7h00 - 12h00\nChiều: 13h30 - 16h30</strong>\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Bệnh viện có nhiều khu khám bệnh, hiện tại BookingCare đang hỗ trợ đăng ký khám tại tòa nhà C4 - Khoa khám bệnh theo yêu cầu. Người bệnh đến khám đúng tòa nhà C4 để được hỗ trợ.</li>\n<li>Bệnh viện chuyên về Ngoại khoa nên lịch của các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</li>\n<li>Mỗi bệnh nhân trong ngày chỉ được đặt trước 1 chuyên khoa, nếu đăng kí 2 chuyên khoa trở lên sẽ trao đổi bác sĩ thăm khám ban đầu chuyển khám thêm khoa khác.</li>\n</ul>\n<p><strong>Chi phí khám</strong></p>\n<p>Người bệnh có thể lựa chọn một trong các gói khám sau:</p>\n<p>Gói 1:</p>\n<ul>\n<li>Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám</li>\n</ul>\n<p>Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\nGói 2:</p>\n<ul>\n<li>Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</li>\n</ul>\n<h4><strong>THẾ MẠNH CHUYÊN MÔN</strong></h4>\n<p>Bệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:</p>\n<ul>\n<li><strong>Khám, điều trị, phẫu thuật về Thần kinh (Thần kinh I, Thần kinh II):</strong> Chấn thương; Bệnh lý sọ não; Tuỷ sống; Dây thần kinh ngoại vi; Ứng dụng nội soi trong phẫu thuật thần kinh; Phẫu thuật thần kinh chức năng; Phẫu thuật u nền sọ;...</li>\n<li></li>\n<li><strong>Khám, điều trị, phẫu thuật về Cơ xương khớp:</strong></li>\n<li><strong>Khám, điều trị, phẫu thuật về Chi trên và Y học thể thao:</strong> Khám các bệnh lý do chấn thương thể thao; Bệnh lý đứt dây chằng gối do chơi thể thao; Chấn thương chỉnh hình xương khớp; Phẫu thuật bàn tay; Bệnh lý cơ xương khớp về tay;...</li>\n<li><strong>Khám, điều trị, phẫu thuật về Chi dưới:</strong> Điều trị thoái hóa khớp gối, khớp háng; Bệnh lý đứt dây chằng gối; Phẫu thuật khớp gối, khớp háng, khớp cổ chân; Bệnh lý về chân;...</li>\n<li><strong>Khám, điều trị, phẫu thuật về Xương và điều trị ngoại trú:</strong> Nắn chỉnh về xương, tai nạn bị gãy tay gãy chân, tháo bột, kiểm tra lại sau khi nắn chỉnh về xương.</li>\n<li><strong>Khám, điều trị, phẫu thuật về chấn thương chung:</strong> tháo đinh, kiếm tra lại sau mổ,...</li>\n<li><strong>Khám, điều trị, phẫu thuật về Cột sống: Bệnh lý cột sống;</strong> Đau vai gáy; Thoái hoá và thoát vị đĩa đệm; Chấn thương chỉnh hình cột sống; Trượt đốt sống; Vẹo cột sống; Bơm xi-măng vào thân đốt sống;...</li>\n<li><strong>Khám, điều trị, phẫu thuật về Tim mạch và lồng ngực:</strong> Khám và điều trị bệnh lý tim bẩm sinh trẻ em; Khám và điều trị các bệnh lý nội, ngoại khoa về tim mạch; Điều trị các bệnh lý phức tạp về động - tĩnh mạch bằng các phương pháp tiên tiến; Các bệnh lý về xương sườn;...</li>\n<li><strong>Khám, điều trị, phẫu thuật về Tạo hình-Hàm mặt-Thẩm mỹ:</strong> Bệnh lý và chấn thương vùng hàm mặt; Phục hồi tái tạo các cơ quan sau điều trị ung thư; Sửa chữa các dị tật sọ mặt; Nối vành tai đứt rời, mũi đứt rời ; Phẫu thuật thẩm mĩ mi mắt, mũi, tạo hình ngực, bụng….</li>\n<li><strong>Khám, điều trị, phẫu thuật về Tiêu hóa:</strong> Cắt bỏ và tạo hình thực quản; Cắt khối tá tuỵ; Cắt toàn bộ dạ dày, cắt đại tràng các loại.</li>\n</ul>\n<p><strong>Ngoài ra, bệnh viện khám, điều trị, phâu thuật các chuyên khoa khác như:</strong></p>\n<ul>\n<li>Bệnh lý thần kinh</li>\n<li>Nội - Hồi sức thần kinh</li>\n<li>Bệnh tim mạch và lồng ngực</li>\n<li>Phẫu thuật tim mạch - lồng ngực</li>\n<li>Ngoại nhi và trẻ sơ sinh</li>\n<li>Bệnh lý tiêu hóa</li>\n<li>Phẫu thuật tiêu hóa</li>\n<li>Bệnh cột sống/thoát vị đĩa đệm</li>\n<li>Chi trên và y học  thể thao</li>\n<li>Bệnh lý chi dưới</li>\n<li>Khám xương và điều trị ngoại trú</li>\n<li>Phẫu thuật chấn thương chung</li>\n<li>Phẫu thuật tạo hình - hàm mặt - thẩm mỹ</li>\n<li>Phục hồi chức năng</li>\n<li>Nhiễm khuẩn</li>\n<li>Phẫu thuật nhiễm khuẩn</li>\n<li>Bệnh đường tiết niệu</li>\n<li>Bệnh nam học/nam khoa</li>\n<li>Bệnh lý gan mật</li>\n<li>Ung bướu</li>\n<li>Thận lọc máu</li>\n<li>Bệnh lý hậu môn trực tràng</li>\n<li>Trung tâm ghép tạng</li>\n<li>Phòng khám Tai mũi họng</li>\n</ul>\n<h4><strong>TRANG THIẾT BỊ</strong></h4>\n<p>Bệnh viện Việt Đức được trang bị hầu hết các trang thiêt bị hiện đại hàng đầu hiện nay phục vụ trong chẩn đoán và thực hiện các xét nghiệm cơ bản, xét nghiệm kỹ thuật cao như các xét nghiệm theo dõi bệnh nhân ghép tạng, các xét nghiệm chỉ điểm khối u.</p>\n<ul>\n<li>Xquang số hóa</li>\n<li>Máy siêu âm</li>\n<li>Máy chụp cắt lớp vi tính đa dãy CT Scan</li>\n<li>Máy chụp cộng hưởng từ MRI 3.0 Tesla</li>\n<li>Hệ thống chụp mạch máy chuyên dụng</li>\n<li>Hệ thống PET/CT phát hiện ung thư sớm và đánh giá các bệnh lý tim mạch, thần kinh</li>\n<li>Hệ thống máy sinh hóa miễn dịch tự động, máy sinh hóa tự động, máy xét nghiệm huyết học, xét nghiệm đông máu tự động…</li>\n</ul>\n<p>Các thiết bị thăm dò chức năng hỗ trợ thăm khám và thực hiện các thủ thuật nội soi tiêu hóa - gan mật.</p>\n<p>Nội soi thực quản - dạ dày - tá tràng chẩn đoán\nNội soi đại trực tràng chẩn đoán\nNội soi đường mật - tụy ngược dòng ERCP\nSiêu âm nội soi chẩn đoán bệnh lý thuộc cơ quan tiêu hóa, chọc hút tế bào\nNội soi can thiệp, nong hẹp đường tiêu hóa\nNội soi đặt stent khí quản, đặt sonde tá tràng\nNội soi can thiệp đại tràng.</p>\n<h4><strong>VỊ TRÍ</strong></h4>\n<p>Các trang web khác ghi địa chỉ Bệnh viện Việt Đức ở 40 Tràng Thi, đây là cổng chính nhưng thông thường chỉ dành cho những công việc giấy tờ, hành chính. Bệnh nhân đến khám sẽ đi các cổng phụ trên đường Phủ Doãn.</p>\n<p>Trên đường Phủ Doãn có 3 cổng và đường Tràng Thi có 1 cổng chính. Người bệnh nên đi đúng cổng như chỉ dẫn để đi đến phòng khám dễ dàng, nhanh chóng nhất.\n<img src=\"https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/133335so-do-benh-vien-viet-duc.jpg\" alt=\"img\"></p>\n<h4><strong>QUY TRÌNH KHÁM</strong></h4>\n<p>Dưới đây là Hướng dẫn làm thủ tục ưu tiên cho người bệnh đặt khám qua BookingCare tại Bệnh viện Hữu nghị Việt Đức.\n<img src=\"https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/095133-quy-trinh-kham-khu-c4.png\" alt=\"img\">\n<strong>CỤ THỂ:</strong></p>\n<ol>\n<li>Bạn đến cổng số 16-18 Phủ Doãn</li>\n</ol>\n<p>Về nơi gửi xe:</p>\n<ul>\n<li>Xe máy gửi tại bãi đỗ xe trước cửa bệnh viện (có nhân viên bảo vệ hướng dẫn).</li>\n<li>Xe ô tô: Hiện tại Bệnh viện chưa có chỗ gửi xe ô tô riêng biệt, xe ô tô bạn có thể gửi tại Cung Văn hóa Hữu nghị Việt Xô, cách bệnh viện khoảng 500m. Nếu được, bạn nên đi taxi để thuận tiện hơn.\n<img src=\"https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/114926cong--so--1-benh-vien-viet-duc.jpg\" alt=\"img\"></li>\n</ul>\n<ol start=\"2\">\n<li>Bạn đến Tòa nhà C4: Tòa nhà thứ 2 bên tay trái từ cổng vào số 16-18 Phủ Doãn.\n<img src=\"https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/160715-c4-bv-viet-duc.jpg\" alt=\"img\"></li>\n<li>Vào tầng 1, ĐẾN QUẦY CUNG CẤP THÔNG TIN BÁO ĐẶT QUA BookingCARE. Quý khách đưa tin nhắn xác nhận thành công hoặc hướng dẫn đi khám để nhân viên hỗ trợ (xem thêm hình dưới).\n<img src=\"https://raw.githubusercontent.com/luongdz0101/Front-end/main/src/assets/list%20clinic/160921-cung-cap-thong-tin-vd1.jpg\" alt=\"img\"></li>\n</ol>\n<ul>\n<li>Quý khách lấy số ưu tiên và chờ gọi số tại quầy đăng ký số 7,9 (phiếu khám đã được in sẵn, người bệnh KHÔNG cần khai báo thêm).</li>\n<li></li>\n</ul>\n<p><strong>LƯU Ý:</strong></p>\n<ul>\n<li>Thời gian phát số ưu tiên sau 07h30. Trường hợp quý khách đến trước 07h30, quý khách vui lòng ngồi chờ tại khu vực sảnh chờ nhà D của bệnh viện</li>\n<li>Do đặc thù của Bệnh viện Ngoại khoa, Trường hợp Bác sĩ đã đặt có ca CẤP CỨU, PHẪU THUẬT CẤP CỨU, nhân viên lễ tân sẽ sắp xếp cho bạn khám với một bác sĩ khác có chuyên môn và giá khám tương đương.</li>\n</ul>\n<ol start=\"4\">\n<li>Bạn sẽ nhận được phiếu khám có dán tem ưu tiên\n<img src=\"\" alt=\"img\"></li>\n</ol>\n', , 'Hệ thống Y tế Thu Cúc TCI', '2023-12-04 17:18:18', '2023-12-04 17:18:18');
