(3, '<h3><strong>Bác sĩ Chuyên khoa II Trần Nghi</strong></h3>\n<ul>\n<li>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<ul>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n', '\n### **Bác sĩ Chuyên khoa II Trần Nghi**\n\n\n\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n*  Bác sĩ nhận khám từ 16 tuổi trở lên\n\n\n\n### **Quá trình đào tạo**\n\n\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n\n\n###  **Quá trình công tác**\n\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n\n### **Khám và điều trị**\n\n\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...\n', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 105, NULL, NULL, '2023-11-20 14:41:15', '2023-11-27 22:49:07'),
(4, '<h3><strong>Giáo sư, Tiến sĩ Nguyễn Văn Thông</strong></h3>\n<ul>\n<li>Chủ tịch Hội Phòng chống đột quỵ khu vực miền Bắc</li>\n<li>Nguyên Giám đốc Trung tâm đột quỵ - Bệnh viện Trung ương Quân đội 108</li>\n<li>Hơn 35 năm kinh nghiệm khám, điều trị và nghiên cứu trong lĩnh vực Thần kinh</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Giám đốc Trung tâm đột quỵ, Bệnh viện Trung ương Quân đội 108 (2002)</li>\n<li>Phó Chủ nhiệm Khoa thần kinh, Bệnh viện Trung ương Quân đội 108 (1996)</li>\n<li>Bác sĩ điều trị tại Viện Quân y 108 (1985 -1989)</li>\n<li>Công tác tại Cục Nghiên cứu Bộ Tổng tham mưu (1979 - 1984)</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ Chuyên khoa II (1995)</li>\n<li>Tốt nghiệp Phó Tiến sĩ khoa học y dược (1993)</li>\n<li>Tốt nghiệp Bác sĩ Chuyên khoa I Chuyên khoa Nội(1987)</li>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Học viện Quân y (1979)</li>\n<li>Khoảng 11 năm học tập và nghiên cứu tại Philipine và Mỹ về chuyên khoa Thần kinh</li>\n</ul>\n<h3><strong>Sách và công trình nghiên cứu khoa học</strong></h3>\n<ul>\n<li>Chủ biên nhiều cuốn sách: Bệnh học Thần kinh (2013); Bệnh thoái hóa cột sống cổ (2009); Hướng dẫn chăm sóc người bệnh đột quỵ (2008);...</li>\n<li>Công bố 75 bài báo khoa học trên tạp chí y học trong nước và quốc tế</li>\n<li>15 cuốn sách chuyên khảo, giáo trình giảng dạy đại học và sau đại học</li>\n<li>Thành viên các Hội khoa học, tổ chức chuyên môn</li>\n<li>Chủ tịch Hội Phòng chống đột quỵ khu vực miền Bắc</li>\n<li>Phó Chủ tịch Hội Phòng chống đột quỵ Việt Nam</li>\n<li>Ủy viên Hội Thần kinh Việt Nam</li>\n<li>Ủy viên Hội đồng chuyên môn chỉ đạo chương trình đào tạo điều trị đột quỵ, Bộ Y tế</li>\n</ul>\n<h3><strong>Khám và điều trị các bệnh</strong></h3>\n<p>Giáo sư khám, điều trị các bệnh lý chuyên khoa Nội Thần kinh</p>\n<ul>\n<li>Đau nhức đầu</li>\n<li>Mất ngủ kéo dài</li>\n<li>Suy nhược thần kinh.</li>\n<li>Đau dây thần kinh mặt, hầu họng</li>\n<li>Đau thần kinh cổ vai cánh tay</li>\n<li>Đau thần kinh chi dưới, đau thắt lưng cùng</li>\n<li>Đau thần kinh do zona</li>\n<li>Rối loạn thần kinh thực vật: mệt mỏi, hồi hộp, vã mồ hôi, tụt huyết áp</li>\n<li>Các chứng lo âu, trầm cảm, rối loạn trí nhớ</li>\n<li>Chóng mặt, ù tai do hội chứng tiền đình</li>\n<li>Liệt hầu họng, nói khó, nuốt nghẹn, sặc, liệt mắt nhìn đôi</li>\n<li>Liệt 2 chân, liệt 1/2 người</li>\n<li>Vận động tay chân khó khăn, không chính xác</li>\n<li>Run các chi, run toàn thân.</li>\n<li>Bệnh động kinh, cơn co giật, cơn mất ý thức, cơn rối loạn tâm thần</li>\n<li>Bệnh Parkinson, vận động chậm chạp, cứng, run</li>\n<li>Tai biến mạch máu não do huyết áp cao, đái đường, giai đoạn mới, di chứng.</li>\n<li>Các bệnh cơ: teo cơ, bệnh nhược cơ</li>\n<li>Mọi chứng bệnh thần kinh khác do sang chấn, tai nạn, nhiễm trùng, nhiễm độc.</li>\n</ul>\n', '\n### **Giáo sư, Tiến sĩ Nguyễn Văn Thông**\n\n* Chủ tịch Hội Phòng chống đột quỵ khu vực miền Bắc\n* Nguyên Giám đốc Trung tâm đột quỵ - Bệnh viện Trung ương Quân đội 108\n* Hơn 35 năm kinh nghiệm khám, điều trị và nghiên cứu trong lĩnh vực Thần kinh\n* Bác sĩ nhận khám mọi độ tuổi\n\n\n### **Quá trình công tác**\n\n* Giám đốc Trung tâm đột quỵ, Bệnh viện Trung ương Quân đội 108 (2002)\n* Phó Chủ nhiệm Khoa thần kinh, Bệnh viện Trung ương Quân đội 108 (1996)\n* Bác sĩ điều trị tại Viện Quân y 108 (1985 -1989)\n* Công tác tại Cục Nghiên cứu Bộ Tổng tham mưu (1979 - 1984)\n\n\n### **Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ Chuyên khoa II (1995)\n* Tốt nghiệp Phó Tiến sĩ khoa học y dược (1993)\n* Tốt nghiệp Bác sĩ Chuyên khoa I Chuyên khoa Nội(1987)\n* Tốt nghiệp Bác sĩ Đa khoa, Học viện Quân y (1979)\n* Khoảng 11 năm học tập và nghiên cứu tại Philipine và Mỹ về chuyên khoa Thần kinh\n\n\n\n### **Sách và công trình nghiên cứu khoa học**\n\n\n* Chủ biên nhiều cuốn sách: Bệnh học Thần kinh (2013); Bệnh thoái hóa cột sống cổ (2009); Hướng dẫn chăm sóc người bệnh đột quỵ (2008);...\n* Công bố 75 bài báo khoa học trên tạp chí y học trong nước và quốc tế\n* 15 cuốn sách chuyên khảo, giáo trình giảng dạy đại học và sau đại học\n* Thành viên các Hội khoa học, tổ chức chuyên môn\n* Chủ tịch Hội Phòng chống đột quỵ khu vực miền Bắc\n* Phó Chủ tịch Hội Phòng chống đột quỵ Việt Nam\n* Ủy viên Hội Thần kinh Việt Nam\n* Ủy viên Hội đồng chuyên môn chỉ đạo chương trình đào tạo điều trị đột quỵ, Bộ Y tế\n\n\n### **Khám và điều trị các bệnh**\n\n\n\nGiáo sư khám, điều trị các bệnh lý chuyên khoa Nội Thần kinh\n\n\n\n* Đau nhức đầu\n* Mất ngủ kéo dài\n* Suy nhược thần kinh.\n* Đau dây thần kinh mặt, hầu họng\n* Đau thần kinh cổ vai cánh tay\n* Đau thần kinh chi dưới, đau thắt lưng cùng \n* Đau thần kinh do zona\n* Rối loạn thần kinh thực vật: mệt mỏi, hồi hộp, vã mồ hôi, tụt huyết áp \n* Các chứng lo âu, trầm cảm, rối loạn trí nhớ\n* Chóng mặt, ù tai do hội chứng tiền đình\n* Liệt hầu họng, nói khó, nuốt nghẹn, sặc, liệt mắt nhìn đôi\n* Liệt 2 chân, liệt 1/2 người\n* Vận động tay chân khó khăn, không chính xác\n* Run các chi, run toàn thân.\n* Bệnh động kinh, cơn co giật, cơn mất ý thức, cơn rối loạn tâm thần\n* Bệnh Parkinson, vận động chậm chạp, cứng, run\n* Tai biến mạch máu não do huyết áp cao, đái đường, giai đoạn mới, di chứng.\n* Các bệnh cơ: teo cơ, bệnh nhược cơ\n* Mọi chứng bệnh thần kinh khác do sang chấn, tai nạn, nhiễm trùng, nhiễm độc.', 'Chủ tịch Hội Phòng chống đột quỵ khu vực miền Bắc\nNguyên Giám đốc Trung tâm đột quỵ - Bệnh viện Trung ương Quân đội 108\nHơn 35 năm kinh nghiệm khám, điều trị và nghiên cứu trong lĩnh vực Thần kinh\nBác sĩ nhận khám mọi độ tuổi', 104, NULL, NULL, '2023-11-20 16:12:59', '2023-11-20 21:29:32'),
(5, '<h3><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Thi Hùng</strong></h3>\n<ul>\n<li>Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</li>\n<li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li>\n<li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li>\n<li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li>\n<li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li>\n<li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li>\n<li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li>\n<li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1977)</li>\n<li>Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam</li>\n</ul>\n<h3><strong>Phó Giáo sư khám và điều trị</strong></h3>\n<p>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</p>\n<ul>\n<li>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</li>\n<li>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</li>\n<li>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</li>\n<li>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</li>\n<li>Viêm da cơ địa trẻ em và người lớn</li>\n<li>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</li>\n<li>Tổ đỉa</li>\n<li>Mày đay</li>\n<li>Bạch biến</li>\n<li>Vảy nến</li>\n<li>Rụng tóc</li>\n<li>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</li>\n<li>Zona, Thủy đậu, Herpes</li>\n<li>Ghẻ</li>\n<li>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</li>\n<li>Viêm mao mạch dị ứng</li>\n<li>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</li>\n<li>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</li>\n<li>Một số bệnh lông - tóc - móng</li>\n<li>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</li>\n<li>Tiêm tái sinh nang tóc</li>\n</ul>\n<p><strong>Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu</strong></p>\n', '\n### **Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Thi Hùng**\n\n* Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu\n* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\n* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\n* Tốt nghiệp Đại học Y Hà Nội (1977)\n* Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam\n\n\n### **Phó Giáo sư khám và điều trị**\n\n\n \nCác bệnh lý về chuyên sâu về da liễu người lớn và trẻ em\n\n\n\n\n* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)\n* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá\n* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da\n* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm\n* Viêm da cơ địa trẻ em và người lớn\n* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu\n* Tổ đỉa\n* Mày đay\n* Bạch biến\n* Vảy nến\n* Rụng tóc\n* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ\n* Zona, Thủy đậu, Herpes\n* Ghẻ\n* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc\n* Viêm mao mạch dị ứng\n* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc\n* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã\n* Một số bệnh lông - tóc - móng\n* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\n* Tiêm tái sinh nang tóc\n\n**Và các bệnh lý chuyên sâu khác về chuyên khoa Da liễu**', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam', 103, NULL, NULL, '2023-11-20 21:33:10', '2023-11-20 21:38:52'),
(6, '<h3>*<em>Bác sĩ Chuyên Khoa II Lam Thuỳ Nga</em></h3>\n<ul>\n<li>Bác sĩ có nhiều năm kinh nghiệm trong khám và điều trị về xương khớp - Thận</li>\n<li>Bác sĩ đang công tác tại khoa Thận khớp, Bệnh viện 108</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<ul>\n<li>Bệnh lý xương khớp</li>\n<li>khám nội chung</li>\n<li>Khám thận - khớp</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Hiện tại bác sĩ đang công tác tại Bệnh viện Trung ương Quân đội 108</li>\n</ul>\n', '\n### **Bác sĩ Chuyên Khoa II Lam Thuỳ Nga*\n\n* Bác sĩ có nhiều năm kinh nghiệm trong khám và điều trị về xương khớp - Thận\n* Bác sĩ đang công tác tại khoa Thận khớp, Bệnh viện 108\n\n### **Khám và điều trị**\n\n* Bệnh lý xương khớp\n* khám nội chung \n* Khám thận - khớp \n\n\n### **Quá trình công tác**\n* Hiện tại bác sĩ đang công tác tại Bệnh viện Trung ương Quân đội 108', 'Bác sĩ có nhiều năm kinh nghiệm trong khám và điều trị về xương khớp - Thận\nBác sĩ đang công tác tại khoa Thận khớp bệnh viện 108', 102, NULL, NULL, '2023-11-20 21:36:18', '2023-11-20 21:36:18'),
(7, '<h3><strong>Bác sĩ Chuyên khoa I Nguyễn Hùng</strong></h3>\n<ul>\n<li>Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần</li>\n<li>Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM</li>\n<li>Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp</li>\n<li>Bác sĩ nhận khám từ 10 tuổi trở lên</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<p>Bác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:</p>\n<ul>\n<li>Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu),tâm thần phân liệt, do bệnh động kinh</li>\n<li>Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Mất ngủ</li>\n<li>Rối loạn stress</li>\n<li>Sang chấn sau stress</li>\n<li>Đau đầu do căng thẳng</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>\n<p>Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)</p>\n</li>\n<li>\n<p>Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM</p>\n</li>\n<li>\n<p>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật</p>\n</li>\n<li>\n<p>Khám sức khỏe tâm thần cho các trung tâm cai nghiện</p>\n</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)</li>\n<li>Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)</li>\n<li>Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)</li>\n</ul>\n<h3><strong>Sách, các công trình nghiên cứu và báo cáo khoa học</strong></h3>\n<p>Các nghiên cứu khoa học đã tham gia:</p>\n<ul>\n<li>Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)</li>\n<li>Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)</li>\n<li>Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)</li>\n<li>Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)</li>\n<li>Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)</li>\n</ul>\n', '\n### **Bác sĩ Chuyên khoa I Nguyễn Hùng**\n\n* Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\n* Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM\n* Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\n* Bác sĩ nhận khám từ 10 tuổi trở lên\n\n\n### **Khám và điều trị**\n\nBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:\n\n* Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu),tâm thần phân liệt, do bệnh động kinh\n* Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực\n* Rối loạn giấc ngủ\n* Mất ngủ\n* Rối loạn stress\n* Sang chấn sau stress\n* Đau đầu do căng thẳng\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ\n\n\n### **Quá trình công tác**\n\n* Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)\n* Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật\n\n* Khám sức khỏe tâm thần cho các trung tâm cai nghiện\n\n\n### **Quá trình đào tạo**\n\n* Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)\n* Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)\n* Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)\n\n\n### **Sách, các công trình nghiên cứu và báo cáo khoa học**\n\nCác nghiên cứu khoa học đã tham gia:\n\n* Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)\n* Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)\n* Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)\n* Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)\n* Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)', 'Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\nHiện đang công tác tại Bệnh viện Tâm thần TP. HCM\nThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\nBác sĩ nhận khám từ 10 tuổi trở lên', 101, NULL, NULL, '2023-11-20 21:38:19', '2023-11-20 21:38:19'),
(8, '<p><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</strong></p>\n<ul>\n<li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li>\n<li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li>\n<li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li>\n<li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li>\n<li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li>\n<li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li>\n<li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1977)</li>\n<li>Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam</li>\n<li>Phó Giáo sư khám và điều trị</li>\n<li>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</li>\n<li></li>\n<li>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</li>\n<li>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</li>\n<li>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</li>\n<li>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</li>\n<li>Viêm da cơ địa trẻ em và người lớn</li>\n<li>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</li>\n<li>Tổ đỉa</li>\n<li>Mày đay</li>\n<li>Bạch biến</li>\n<li>Vảy nến</li>\n<li>Rụng tóc</li>\n<li>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</li>\n<li>Zona, Thủy đậu, Herpes</li>\n<li>Ghẻ</li>\n<li>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</li>\n<li>Viêm mao mạch dị ứng</li>\n<li>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</li>\n<li>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</li>\n<li>Một số bệnh lông - tóc - móng</li>\n<li>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</li>\n<li>Tiêm tái sinh nang tóc</li>\n<li>Và các bệnh lý chuyên sâu khác về chuyên khoa</li>\n</ul>\n<p>Da liễu</p>\n', '**Phó Giáo sư, Tiến sĩ, Bác sĩ Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu**\n* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\n* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\n* Tốt nghiệp Đại học Y Hà Nội (1977)\n* Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam\n* Phó Giáo sư khám và điều trị\n* Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em\n* \n* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)\n* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá\n* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da\n* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm\n* Viêm da cơ địa trẻ em và người lớn\n* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu\n* Tổ đỉa\n* Mày đay\n* Bạch biến\n* Vảy nến\n* Rụng tóc\n* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ\n* Zona, Thủy đậu, Herpes\n* Ghẻ\n* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc\n* Viêm mao mạch dị ứng\n* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc\n* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã\n* Một số bệnh lông - tóc - móng\n* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\n* Tiêm tái sinh nang tóc\n* Và các bệnh lý chuyên sâu khác về chuyên khoa\n\n Da liễu', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam', 107, NULL, NULL, '2023-11-22 15:23:40', '2023-11-22 15:30:32'),
