(5, 'Ảo thanh hay tư duy phát thành tiếng là gì?', '<p><strong>Ảo thanh hay tư duy phát thành tiếng là gì?</strong></p>\n<p><strong>Câu hỏi:</strong></p>\n<p>Chào bác sĩ em bị ảo thanh nhưng em không hiểu tại sao nó không nghe tiếng trong đầu hay bên tai, mà em bị phát tiếng nói trong lòng (trong tâm) kiểu như trong tâm nó tự động phát ra thành tiếng, em cũng hay sợ người khác nghe được tiếng em phát ra, em không dám ra ngoài luôn, bác sĩ cho em hỏi đây là loại ảo thanh gì ạ? Hay là tư duy phát thành tiếng bác sĩ? Và người khác có nghe được không ạ?</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi\nTiến sĩ, Bác sĩ Đinh Việt Hùng (Bác sĩ từ xa)</p>\n<p>Đây là ảo thanh giả nhé, không phải tư duy vang thành tiếng. Người khác không nghe được nhé.</p>\n', , '**Ảo thanh hay tư duy phát thành tiếng là gì?**\n\n**Câu hỏi:**\n\nChào bác sĩ em bị ảo thanh nhưng em không hiểu tại sao nó không nghe tiếng trong đầu hay bên tai, mà em bị phát tiếng nói trong lòng (trong tâm) kiểu như trong tâm nó tự động phát ra thành tiế', '2024-01-06 10:31:30', '2024-01-06 10:31:30');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(7, 'Cho hỏi mình đang bị loét dạ dày, vậy dùng thuốc viêm mũi dị ứng Meseca chứa Azelastine và Fluticason propionate có gây hại cho dạ dày không? Dùng lâu có ảnh hưởng dạ dày không?', '<p><strong>Câu hỏi:</strong></p>\n<p>Cho hỏi mình đang bị loét dạ dày, vậy dùng thuốc viêm mũi dị ứng Meseca chứa Azelastine và Fluticason propionate có gây hại cho dạ dày không? Dùng lâu có ảnh hưởng dạ dày không?</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi</p>\n<p>Thạc sĩ, Bác sĩ Vũ Văn Huỳnh (Bác sĩ từ xa)</p>\n<p>Fluticason là Corticoid có ảnh hưởng dạ dày, 2 loại kia thì không. Thuốc xịt thì mức độ ảnh hưởng cũng nhẹ.</p>\n', , '**Câu hỏi:**\n\nCho hỏi mình đang bị loét dạ dày, vậy dùng thuốc viêm mũi dị ứng Meseca chứa Azelastine và Fluticason propionate có gây hại cho dạ dày không? Dùng lâu có ảnh hưởng dạ dày không?\n\n**Trả lời:**\n\nĐược trả lời bởi\n\nThạc sĩ, Bác sĩ Vũ Văn Huỳnh (', '2024-01-06 10:35:38', '2024-01-06 10:35:38');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(8, 'Áp lạnh cổ tử cung là gì? Khi nào cần  áp lạnh cổ tử cung?', '<p><strong>Câu hỏi:</strong></p>\n<p>Chào bác sĩ, em có áp lạnh cổ tử cung ở bệnh viện nổi tiếng do bác sĩ chuyên khoa cách đây 1 tháng. 2 tuần nay có cảm giác sót khó chịu. Em có đi khám thì bác sĩ nói đang lành kéo da non nhưng lúc nội soi em thấy  vẫn đỏ có sinh khiết cổ tử cung, vẫn cảm giác khó chịu ạ. Em có nên áp lạnh lần 2 không ạ?  Bác sĩ nói 1 tháng là vết thương lành nhưng hơn 1 tháng 7 ngày rồi. Em không biết là vết thương đang lành hay vẫn còn viêm nhiễm. Xin ý kiến bác sĩ tư vấn giúp ạ.</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi</p>\n<p>Bác sĩ Văn Thu Uyên (Cộng đồng)</p>\n<p>Chào bạn, để đánh giá kĩ tổn thương thì quan sát trực tiếp là rất quan trọng, hiện tại bạn chưa cần đi áp lạnh lại nhé. Vệ sinh âm hộ 2 lần/ ngày và tuyệt đối không cho tay vào âm đạo, kiêng quan hệ trong thời gian này và khám lại theo lịch hẹn của bác  sĩ đã áp lạnh cho bạn nhé.</p>\n', , '**Câu hỏi:**\n\nChào bác sĩ, em có áp lạnh cổ tử cung ở bệnh viện nổi tiếng do bác sĩ chuyên khoa cách đây 1 tháng. 2 tuần nay có cảm giác sót khó chịu. Em có đi khám thì bác sĩ nói đang lành kéo da non nhưng lúc nội soi em thấy  vẫn đỏ có sinh khiết cổ tử ', '2024-01-06 10:39:06', '2024-01-06 10:39:06');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(9, 'Nên dùng gì để hết cho tình trạng da mụn và thâm?', '<p><strong>Câu hỏi:</strong></p>\n<p>Nên dùng gì để hết cho tình trạng da mụn và thâm như ảnh ạ?</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi</p>\n<p>Thạc sĩ, Bác sĩ Phạm Đăng Bảng (Bác sĩ từ xa)</p>\n<p>Việc điều trị mụn cần xem xét toàn diện chứ không thể kê đơn qua 1 hình ảnh duy nhất. Vậy bạn nên đi khám chuyên khoa Da liễu để các bác sĩ khám cẩn thận và kê đơn chuẩn. Hoặc có thể đăng ký khám da liễu online trên app Booking Care</p>\n', , '**Câu hỏi:**\n\nNên dùng gì để hết cho tình trạng da mụn và thâm như ảnh ạ?\n\n**Trả lời:**\n\nĐược trả lời bởi\n\nThạc sĩ, Bác sĩ Phạm Đăng Bảng (Bác sĩ từ xa)\n\nViệc điều trị mụn cần xem xét toàn diện chứ không thể kê đơn qua 1 hình ảnh duy nhất. Vậy bạn nên đi ', '2024-01-06 10:40:07', '2024-01-06 10:40:07');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(10, 'Viêm lộ tuyến có nguy hiểm không?', '<p><strong>Câu hỏi:</strong></p>\n<p>Em có bị viêm âm đạo do nấm điều trị thì thấy đở hơn không còn ngứa ngáy nữa, nhưng do em chưa sanh đẻ nên là chưa điều trị tận gốc đuợc bác sĩ có cho thuốc đặt phòng ngừa viêm nấm lại và đi khám thì phát hiện tử cung bị viêm lộ tuyết diện rộng, thì có nguy hiểm không ạ, có phương pháp chửa trị không ạ, bác sĩ có đề nghị em xét nghiêp hpv tử cung đang đợi lấy kết quả do từ trước giờ em cứ nghĩ viêm nấm ngứa thôi không nghĩ bị viêm lộ tuyến tử cung ạ em lo quá</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi</p>\n<p>Bác sĩ Văn Thu Uyên (Cộng đồng)</p>\n<p>Chào bạn, lộ tuyến cổ tử cung là tình trạng sinh lí của cơ thể, rất hay gặp trong độ tuổi sinh sản. Cơ thể có thể làm lành tổn thương này, nhưng mình sẽ phải tạo điều kiện cho nó bằng cách: sàng lọc ung thư cổ tử cung định kì ( tế bào học và HPV), điều trị viêm nhiễm âm đạo nếu có. Với trường hợp của bạn thì mình cứ đợi kết quả sàng lọc trước nha, kiểm tra lại phụ khoa xem còn viêm không và nếu lộ tuyến quá rộng, gây tăng tiết dịch nhiều bạn có thể đi đốt lộ tuyến nha. Bạn không cần lo lắng quá nha</p>\n', , '**Câu hỏi:**\n\nEm có bị viêm âm đạo do nấm điều trị thì thấy đở hơn không còn ngứa ngáy nữa, nhưng do em chưa sanh đẻ nên là chưa điều trị tận gốc đuợc bác sĩ có cho thuốc đặt phòng ngừa viêm nấm lại và đi khám thì phát hiện tử cung bị viêm lộ tuyết diện r', '2024-01-06 10:42:53', '2024-01-06 10:42:53');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(11, 'Cho em hỏi muốn khám tiền sản trước khi mang thai thì cần khám những gì và khám ở đâu?', '<p><strong>Câu hỏi:</strong></p>\n<p>Cho em hỏi muốn khám tiền sản trước khi mang thai thì cần khám những gì và khám ở đâu ạ?</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi\nBác sĩ Văn Thu Uyên (Cộng đồng)</p>\n<p>Chào bạn, với khám tiền hôn nhân, bạn có thể khám ở khoa hỗ trợ sinh sản của các viện: Đại học Y Hà Nội, Bệnh viện Bưu Điện, Bệnh viện Tâm Anh hay Bệnh viện Từ Dũ. Tùy vào nơi bạn đang ở nha.</p>\n<p>Khám sẽ khám cho vợ và chồng:</p>\n<ul>\n<li>Chồng có thể đi khám ngày nào cũng được: siêu âm tinh hoàn, xét nghiệm tinh dịch đồ, và xét nghiệm máu đánh giá tình trạng sức khỏe.</li>\n<li>Vợ sẽ đi khám vào hai ngày:\nLần 1: khám vào ngày thứ 2 của chu kì kinh (ngày đầu ra máu tính là ngày thứ 1), đến ngày thứ 2, đang ra máu bạn sẽ đi khám: làm xét nghiệm nội tiết, siêu âm nang trứng.\nLần 2: đi khám vào ngày thứ 2 sau sạch kinh và phải kiêng quan hệ. Đi khám phụ khoa, nếu không viêm nhiễm sẽ chụp x-Quang tử cung- vòi trứng nhé.</li>\n</ul>\n', , '**Câu hỏi:**\n\nCho em hỏi muốn khám tiền sản trước khi mang thai thì cần khám những gì và khám ở đâu ạ?\n\n**Trả lời:**\n\nĐược trả lời bởi\nBác sĩ Văn Thu Uyên (Cộng đồng) \n\nChào bạn, với khám tiền hôn nhân, bạn có thể khám ở khoa hỗ trợ sinh sản của các viện:', '2024-01-06 10:44:44', '2024-01-06 10:44:44');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(12, 'Hay bức rức trong người, lo lắng và nghĩ nhiều thì nên làm như nào ạ?', '<p><strong>Câu hỏi:</strong></p>\n<p>Hay bức rức trong người, lo lắng và nghĩ nhiều thì nên làm như nào ạ?</p>\n<p><strong>Trả lời:</strong></p>\n<p>Ảnh câu hỏi\nĐược trả lời bởi\nThạc sĩ, Bác sĩ Vũ Văn Huỳnh (Bác sĩ từ xa)\nCó thể bạn bị rối loạn lo âu.</p>\n', , '**Câu hỏi:**\n\nHay bức rức trong người, lo lắng và nghĩ nhiều thì nên làm như nào ạ?\n\n**Trả lời:**\n\nẢnh câu hỏi\nĐược trả lời bởi\nThạc sĩ, Bác sĩ Vũ Văn Huỳnh (Bác sĩ từ xa)\nCó thể bạn bị rối loạn lo âu. ', '2024-01-06 10:45:34', '2024-01-06 10:45:34');
INSERT INTO `questions` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(13, 'Triệu chứng mất tập trung, chán nản, cáu giận là gặp vấn đề gì?', '<p><strong>Câu hỏi:</strong></p>\n<p>Bác Sĩ ơi!\nTình trạng em đang gặp là mất tập trung, chán nản, cáu giận là tình trạng như thế nào ạ?\nEm năm nay 17 tuổi là nữ giới ạ.\nTriệu chứng, dấu hiệu sức khỏe của em không ổn lắm.\nVà em cũng chưa đi khám ạ</p>\n<p><strong>Trả lời:</strong></p>\n<p>Được trả lời bởi\nThạc sĩ, Bác sĩ Vũ Văn Huỳnh (Bác sĩ từ xa)\nCó thể em bị rối loạn lo Âu hoặc trầm cảm. Em đến khoa tâm thần các bệnh viện lớn để khám nhé. Chúc em nhanh khoẻ</p>\n', , '**Câu hỏi:**\n\nBác Sĩ ơi! \nTình trạng em đang gặp là mất tập trung, chán nản, cáu giận là tình trạng như thế nào ạ?\nEm năm nay 17 tuổi là nữ giới ạ.\nTriệu chứng, dấu hiệu sức khỏe của em không ổn lắm.\nVà em cũng chưa đi khám ạ\n\n**Trả lời:**\n\nĐược trả lời b', '2024-01-06 10:46:56', '2024-01-06 10:46:56');
