INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(6, 'Cơ xương khớp', '<p><strong>Bác sĩ Cơ Xương Khớp giỏi</strong></p>\n<p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li>\n<li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p>Bệnh Cơ Xương Khớp</p>\n<ul>\n<li>Gout</li>\n<li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương</li>\n<li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Các chấn thương về cơ, xương, khớp</li>\n<li>...</li>\n</ul>\n', , '**Bác sĩ Cơ Xương Khớp giỏi**\n\n\nDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội', '2023-11-29 15:18:02', '2023-12-09 12:32:44');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(7, 'Thần kinh', '<p><strong>Bác sĩ Thần kinh giỏi</strong></p>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p>\n<ul>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<p><strong>Khám bệnh chuyên khoa Thần kinh</strong></p>\n<ul>\n<li>Bại Não</li>\n<li>Đau đầu, chóng mặt, buồn nôn</li>\n<li>Bệnh Pakison, bệnh tiền đình</li>\n<li>Bị co cơ, căng dây thần kinh</li>\n<li>Động kinh, có những cơn vãng ý thức</li>\n<li>Bị tê bì nửa mặt, chèn dây thần kinh</li>\n<li>Bồn chồn, lo lắng, hồi hộp, chân tay run</li>\n<li>Có dấu hiệu tăng động</li>\n<li>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</li>\n<li>Chấn thương đầu, dây thần kinh</li>\n<li>...</li>\n</ul>\n', , '**Bác sĩ Thần kinh giỏi**\n\nDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh v', '2023-11-29 15:19:47', '2023-11-29 15:19:47');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(8, 'Tiêu hoá', '<p><strong>Bác sĩ Chuyên khoa Tiêu hóa</strong></p>\n<p>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></p>\n<ul>\n<li>Ăn uống kém, không ngon</li>\n<li>Rối loạn tiêu hóa, táo bón, trĩ</li>\n<li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li>\n<li>Nội soi dạ dày, đại tràng, tiêu hóa</li>\n<li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li>\n<li>Co thắt thực quản, Hội chứng ruột kích thích</li>\n<li>Đau bụng, dạ dày, đại tràng, thượng vị</li>\n<li>Viêm đại tràng, dạ dày, tá tràng</li>\n<li>Ung thư dạ dày, U nang tuyến tụy</li>\n<li>Bệnh lý về gan, mật</li>\n<li>...</li>\n</ul>\n', , '**Bác sĩ Chuyên khoa Tiêu hóa**\n\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n* Các giáo sư, phó giáo sư là giản', '2023-11-29 15:20:45', '2023-11-29 15:20:45');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(9, 'Tim mạch', '<p><strong>Bác sĩ tim mạch giỏi</strong></p>\n<p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</li>\n<li>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</li>\n<li>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Khám tư vấn tim mạch</strong></p>\n<ul>\n<li>Khó thở, Đau ngực, đau tim</li>\n<li>Tăng huyết áp, hạ huyết áp</li>\n<li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li>\n<li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li>\n<li>Cảm giác hồi hộp, tim đập nhanh</li>\n<li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li>\n<li>Đã đặt stent tim, nong động mạch vành</li>\n<li>Giãn tĩnh mạch chân</li>\n<li>...</li>\n</ul>\n', , '**Bác sĩ tim mạch giỏi**\n\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\n* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại ', '2023-11-29 15:21:35', '2023-11-29 15:21:35');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(10, 'Tai mũi họng', '<p><strong>Bác sĩ Chuyên khoa Tai Mũi Họng</strong></p>\n<p>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Các bệnh Tai Mũi Họng</strong></p>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n<li>Ngủ ng</li>\n</ul>\n', , '**Bác sĩ Chuyên khoa Tai Mũi Họng**\n\nDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng ', '2023-11-29 15:22:26', '2023-11-29 15:22:26');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(11, 'Cột sống', '<p><strong>Bác sĩ Chuyên khoa Cột sống</strong></p>\n<p>Danh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội</li>\n<li>Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Bệnh Thần kinh - Cột sống</strong></p>\n<ul>\n<li>Đau cột sống, đau thắt lưng</li>\n<li>Chấn thương cột sống</li>\n<li>Cột sống bị đau, sưng, cong, vẹo</li>\n<li>Đau mỏi cổ vai gáy, bả vai</li>\n<li>Đau tê mông xuống chân</li>\n<li>Phồng đĩa đệm</li>\n<li>Tê bì tay chân</li>\n<li>Thóa hóa đốt sống</li>\n<li>Thoái hóa L4, L5</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Vôi hóa cột sống</li>\n<li>Xẹp cột</li>\n</ul>\n', , '**Bác sĩ Chuyên khoa Cột sống**\n\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\n* Các giáo', '2023-11-29 15:23:19', '2023-11-29 15:23:19');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(12, 'Châm cứu', '<p><strong>Bác sĩ Châm cứu giỏi</strong></p>\n<p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li>\n</ul>\n<p><strong>Tư vấn, khám và điều trị các vấn đề:</strong></p>\n<ul>\n<li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li>\n<li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li>\n<li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li>\n<li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li>\n</ul>\n', , '**Bác sĩ Châm cứu giỏi**\n\nBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học ', '2023-11-29 15:23:52', '2023-11-29 15:23:52');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(13, 'Sản phụ khoa', '<p><strong>Bác sĩ Sản phụ khoa</strong></p>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội</li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh</li>\n<li>Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,</li>\n<li>Khám hiếm muộn, vô sinh</li>\n<li>Khám Phụ Khoa</li>\n<li>Khám thai sản</li>\n<li>Khám tiền hôn nhân, Tiền sinh</li>\n<li>Kiểm tra phụ khoa</li>\n<li>Loạn dưỡng vú</li>\n<li>Rong kinh kéo dài</li>\n<li>Siêu âm thai định kỳ</li>\n<li>Thai lưu</li>\n<li>U xơ tử cung, Viêm lộ tuyến</li>\n<li>...</li>\n</ul>\n', , '**Bác sĩ Sản phụ khoa**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.\n\n \n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội\n* Các', '2023-11-29 15:24:28', '2023-11-29 15:24:28');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(14, 'Siêu âm thai', '<p><strong>Bác sĩ Siêu âm thai</strong></p>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản - siêu âm thai giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</p>\n<p><strong>Khám và điều trị</strong></p>\n<p>Dưới đây là một số vấn đề thường gặp mà các bác sĩ siêu âm thai thường khám và điều trị</p>\n<ul>\n<li>Khám thai sản</li>\n<li>Khám thai lần đầu</li>\n<li>Siêu âm thai định kỳ</li>\n<li>Siêu âm thai tuần thứ 12</li>\n<li>Siêu âm thai tuần thứ 16</li>\n<li>Siêu âm thai tuần thứ 18</li>\n<li>Siêu âm thai tuần thứ 22</li>\n</ul>\n', , '**Bác sĩ Siêu âm thai**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản - siêu âm thai giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản ', '2023-11-29 15:25:23', '2023-11-29 15:25:23');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(15, 'Nhi khoa', '<p>**Bác sĩ chuyên khoa Nhi **</p>\n<p>Danh sách bác sĩ chuyên khoa Nhi giỏi:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội</li>\n<li>Các giảng viên đã và đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như: Bệnh viện Nhi Trung ương, Khoa Nhi - Bệnh viện Bạch Mai.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Bệnh lý sơ sinh</li>\n<li>Bệnh tiêu hóa</li>\n<li>Bệnh tuần hoàn</li>\n<li>Bệnh hô hấp</li>\n<li>Bệnh huyết học</li>\n<li>Bệnh thận Tiết niệu</li>\n<li>Bệnh thần kinh</li>\n<li>Bệnh ngoài da</li>\n<li>Bệnh xương khớp</li>\n</ul>\n', , '**Bác sĩ chuyên khoa Nhi **\n\nDanh sách bác sĩ chuyên khoa Nhi giỏi:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội\n* Các giảng viên đã và đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà N', '2023-11-29 15:25:57', '2023-11-29 15:25:57');
INSERT INTO `specialties` (`id`, `name`, `descriptionHtml`, `image`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(16, 'Da liễu', '<p><strong>Bác sĩ Chuyên khoa Da liễu</strong></p>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội</p>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Bệnh vẩy nến, Da khô, Ngứa da</li>\n<li>Rám tàn nhang</li>\n<li>Mụn cóc sinh dục</li>\n<li>Nấm cơ thể, Nấm da đầu</li>\n<li>Nấm móng tay, móng chân</li>\n<li>Rụng tóc, hói đầu</li>\n<li>Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã</li>\n<li>Viêm nang lông</li>\n<li>Xơ cứng bì</li>\n<li>Zona thần kinh</li>\n</ul>\n', , '**Bác sĩ Chuyên khoa Da liễu**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trun', '2023-11-29 15:26:31', '2023-11-29 15:26:31');
